    return(
        <div class = "grid grid-flow-col justify-center">
            <div class="absolute ml-[2rem] w-[0.2rem] h-[100vh] bg-white">
                <ul>
                    <li><button/></li>
                    <li><button/></li>
                    <li><button/></li>
